import styled from "styled-components";

const Wrapper = styled.div`
display : flex;
`;


const Btn = styled.button`
  width:200px ;
  height: 200px;
  background-color: ${(props)=>props.bgColor};
`;

const Circle = styled(Box)`
  border-radius: 100px;

`;


function App() {
  return (
  
  <Wrapper>
    <Box bgColor="tomato"/>
    <Circle bgColor="teal"/>
  </Wrapper>
   );

}

export default App;
